#include <stdio.h>
#include <stdlib.h>
#include <string.h>
#include <math.h>

#define MAXN 100005

typedef struct {
    int x1, y1, x2, y2;
} Point;

int cmpx(const void *a, const void *b) {
    Point *p1 = (Point *)a;
    Point *p2 = (Point *)b;
    return p1->x1 - p2->x1;
}

int cmpy(const void *a, const void *b) {
    Point *p1 = (Point *)a;
    Point *p2 = (Point *)b;
    return p1->y1 - p2->y1;
}

int cmpx2(const void *a, const void *b) {
    Point *p1 = (Point *)a;
    Point *p2 = (Point *)b;
    return p1->x2 - p2->x2;
}

int cmpy2(const void *a, const void *b) {
    Point *p1 = (Point *)a;
    Point *p2 = (Point *)b;
    return p1->y2 - p2->y2;
}

int main() {
    int R, C, N;
    scanf("%d %d %d", &R, &C, &N);
    Point points[N];
    for (int i = 0; i < N; i++) {
        scanf("%d %d %d %d", &points[i].x1, &points[i].y1, &points[i].x2, &points[i].y2);
    }
    qsort(points, N, sizeof(Point), cmpx);
    qsort(points, N, sizeof(Point), cmpy);
    int x = 0, y = 0;
    for (int i = 0; i < N; i++) {
        if (points[i].x1 != x || points[i].y1 != y) {
            qsort(points, N, sizeof(Point), cmpx2);
            qsort(points, N, sizeof(Point), cmpy2);
            int flag = 0;
            for (int j = 0; j < N; j++) {
                if (points[j].x1 == x && points[j].y1 == y) {
                    if (points[j].x2 > x && points[j].y2 > y) {
                        flag = 1;
                        break;
                    }
                }
            }
            if (flag == 0) {
                printf("NO\n");
                return 0;
            }
        }
        x = points[i].x1;
        y = points[i].y1;
    }
    printf("YES\n");
    return 0;
}
